import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import Calendar from './Calendar';

function renderApp() {
  ReactDOM.render(
    <React.StrictMode>
      <Calendar />
    </React.StrictMode>,
    document.getElementById('root')
  );
}
function RenderAppButton() {
  return (
    <button onClick={renderApp}>Лабараторная работа №1</button>
  );
}

ReactDOM.createRoot(document.getElementById('root')).render(<RenderAppButton />);
reportWebVitals();
